INSERT INTO `title_dev_contents` (`content_id`, `parent_id`, `content_title`, `content_text`, `meta_title`, `meta_description`, `meta_keywords`, `sef_link`, `content_status`, `addeddate`, `modifieddate`) VALUES
(1, 0, 'Home Update', '<p>Sed adipiscing lorem non eros facilisis ut gravida lectus eleifend. Suspendisse sem lorem, bibendum id blandit nec, dapibus non nunc. Integer eu augue dolor. Suspendisse tempus nibh in orci auctor dictum. Tibendum id blandit nec, dapibus non nunc.</p>\r\n<p>asdfsadfasdf</p>\r\n<p>&nbsp;asdfasdf</p>\r\n<p>&nbsp;</p>', 'My Something New Something Old', 'My Something New Something Old', 'My Something New Something Old', '', 1, '2010-09-23 12:12:30', '2012-01-25 20:49:01'),
(2, 0, 'Help and How to Stay Safe', '<p>&nbsp;</p>\r\n<p><span style="font-size: small;">Hi WhiteDrum users, we believe in the good nature of human beings, that is the reason one will buy something from someone else they have never seen before, living hundreds of miles apart. However we also recognise the fact that some people are not as honest as others, the reason we recommend you stay safe when using this site.</span></p>\r\n<p><span style="font-size: small;"><br /></span></p>\r\n<p><span style="font-size: small;">Here we highlight some tips on how to stay safe online;</span></p>\r\n<p><span style="font-size: small;"><br /></span></p>\r\n<p><span style="font-size: small;">- Always meet up in a public place and go with a friend</span></p>\r\n<p><span style="font-size: small;"><br /></span></p>\r\n<p><span style="font-size: small;">- Never carry large sums of cash</span></p>\r\n<p><span style="font-size: small;"><br /></span></p>\r\n<p><span style="font-size: small;">- Never agree to be paid by money transfers e.g Western Union</span></p>\r\n<p><span style="font-size: small;"><br /></span></p>\r\n<p><span style="font-size: small;">- Always inspect the goods you are buying</span></p>\r\n<p><span style="font-size: small;"><br /></span></p>\r\n<p><span style="font-size: small;">If you think an advert is a scam, please use the Contact Us page to inform us about it and we will investigate this for you.<br /></span></p>\r\n<p><span style="font-size: small;"><br /></span></p>\r\n<p><span style="font-size: small;">The tips are not exhaustive but remember, always go with your instincts. If it sounds too good to be true, it probably is.</span></p>\r\n<p><span style="font-size: small;">Thanks</span></p>\r\n<p>&nbsp;</p>\r\n<p><span style="font-size: small;">The WhiteDrum Team !</span></p>\r\n<p><span style="font-size: small;"><br /></span></p>\r\n<p><span style="font-size: small;"><br /></span></p>\r\n<p><span style="font-size: small;"><br /></span></p>\r\n<p><span style="font-size: small;"><br /></span></p>', 'Help - Nigeria Jobs, Nigerian adverts, Nigeria news, Nigeria news paper, Classified ads, Advertising, nigerianewspaper, dating site, Nigerian dating, Nigerian girls', 'Nigeria Jobs, Nigerian adverts, Nigeria news, Nigeria news paper, Classified ads, Advertising, nigerianewspaper, dating site, Nigerian dating, Nigerian girls', 'Nigeria Jobs, Nigerian adverts, Nigeria news, Nigeria news paper, Classified ads, Advertising, nigerianewspaper, dating site, Nigerian dating, Nigerian girls', '', 1, '2010-09-23 12:22:18', '2010-12-26 16:52:22'),
(3, 0, 'Contact us', '<p>Address:</p>\r\n<p>31- jason street</p>\r\n<p>Kent</p>\r\n<p>da2 354</p>\r\n<p>United Kingdom</p>', 'Contact Us', 'Contact Us', 'Contact Us', '', 1, '2010-09-23 12:23:21', '2011-11-23 15:49:56'),
(4, 0, 'Privacy Policy', '<p>Privacy Policy</p>', 'Privacy Policy', 'Privacy Policy', 'Privacy Policy', '', 1, '2010-09-23 12:23:53', '2011-11-24 03:18:36'),
(5, 0, ' Terms & conditions', '<p><span style="font-size: large;"><strong>this is my terms and conditions<br /></strong></span></p>', ' Terms & conditions', ' Terms & conditions', ' Terms & conditions', '', 1, '2010-09-23 12:24:13', '2011-12-16 19:29:09'),
(6, 0, 'About Us', '<p>On the other hand, we denounce with righteous indignation and dislike  men who are so beguiled and demoralized by the charms of pleasure of the  moment, so blinded by desire, that they cannot foresee the pain and  trouble that are bound to ensue; and equal blame belongs to those who  fail in their duty through weakness of will, which is the same as saying  through shrinking from toil and pain. These cases are perfectly simple  and easy to distinguish. In a free hour, when our power of choice is  untrammelled and when nothing prevents our being able to do what we like  best, every pleasure is to be welcomed and every pain avoided. But in  certain circumstances and owing to the claims of duty or the obligations  of business it will frequently occur that pleasures have to be  repudiated and annoyances accepted. The wise man therefore always holds  in these matters to this principle of selection: he rejects pleasures to  secure other greater pleasures, or else he endures pains to avoid worse  pains</p>', 'About Us', 'About Us', 'About Us', '', 1, '2010-09-23 15:27:27', '2011-11-18 02:09:58'),
(7, 0, 'Register', '<p>1. Classified users &ndash; users selling 2nd hand products (per item)<br />2. Directory users &ndash; these will be retailers who will be advertising their &ldquo;shop&rdquo; on the site.&nbsp; This will be only a directory listing for general users to contact.&nbsp; Retailers will not be selling anything on the site.<br />3. General users &ndash; who will be able to contact the classified sellers either by Telephone or by email &ndash; this is done directly with the seller.</p>', 'Register', 'Register', 'Register', '', 1, '2010-09-28 12:15:06', '2011-11-21 01:01:30'),
(9, 0, 'Post an Ad', '<p>Lorem Ipsum has been the industrys standard dummy text ever since the  1500s, when an unknown printer took a galley of type and scrambled it to  make a type specimen book. It has survived not only five centuries, but  also the leap into electronic typesetting, remaining essentially  unchanged. It was popularised in the 1960s with the release of Letraset  sheets containing Lorem Ipsum passages, and more recently with desktop  publishing software like Aldus PageMaker including versions of Lorem  Ipsum.</p>\r\n<p>this is test description</p>', 'Post an Ad', 'Post an Ad', 'Post an Ad', '', 1, '2011-11-21 02:29:15', '2011-11-26 22:14:21'),
