INSERT INTO `title_dev_news_and_events` (`news_id`, `news_title`, `news_text`, `news_status`, `addeddate`, `modifieddate`) VALUES
(6, 'Jos: Fresh crisis aborts VPâ€™s visit', '<p>\r\n<p><span>The crises that rocked Jos, Plateau State, after the Christmas Eve multiple bombings, escalated on Sunday with no fewer than eight more people killed and scores of others injured in Angwan Rukuba area of the city.</span></p>\r\n<p><span><span><img src="http://www.punchng.com/images/December/Monday/pix20101227251339.jpg" alt="click to expand image" />&nbsp;</span></span></p>\r\n<p><span>The development forced Vice-President Namadi Sambo (Pic above) to shelve his scheduled visit to the city on Sunday.</span></p>\r\n<p><span>Our correspondent in Jos reported that Sunday&rsquo;s crisis began when some Muslim youths in Nasarawa Gwong tried to cross a road through the Cele Bridge near Tina Junction, but were resisted by Christian youths.</span></p>\r\n<p><span>An exchange of gunfire between the youths was said to have resulted in the death of some of residents while others were said to have been matcheted and thereafter set ablaze.</span></p>\r\n<p><span>Also in Gadabiu, where casualties of the Friday night bomb blasts were heavier, youths continued with their violent protests on Sunday morning by attacking people suspected to be members of other religious groups.</span></p>\r\n<p><span>Corpses of victims of the renewed violence were seen on the streets, particularly in Agwa Rukuba, Tina, Dogon Dutse, Rikkos, Gadabiu, Abattior and Dogon Karfe.<span>&nbsp;</span></span></p>\r\n<p><span>As at noon on Sunday, smoke still billowed from bonfires made by the irate youths on the streets in the areas.<span>&nbsp;</span></span></p>\r\n<p><span>Some houses, including churches and mosques, were also set ablaze in Abattoir and Dogon Dutse.<span>&nbsp;</span></span></p>\r\n<p><span>There were also reports that some areas in Angulu Jos, Kaduna Vom and Rikkos village also witnessed some levels of violence.</span></p>\r\n<p><span>Sambo&rsquo;s visit to Jos was said to have been called off following security reports that the crisis had escalated.</span></p>\r\n<p><span>Sambo, according to the Director of Press Affairs to Governor Jonah Jang, Mr. James Mannok, would have visited the scenes of the blasts, the injured and the families of the dead.</span></p>\r\n<p><span>However, the Inspector- General of Police, Mr. Hafiz Ringim, has dispatched the Deputy Inspector-General of Police in charge of operations, Mr. Abubakar Audu, to the crisis-torn city.</span></p>\r\n<p><span>Audu, in company with the Police Commissioner, Mr. Abdulrahman Akano, went round the trouble spots in Angwan Rukuba, Gada Biu and Rikkos.</span></p>\r\n<p><span>Audu, who later addressed a news conference, said that four more units of riot policemen had been deployed in the city from Bauchi, Benue, Gombe and Kano states.</span></p>\r\n<p><span>He expressed confidence in the ability of the police to end the crisis, but disclosed that he had yet to be briefed about casualty rate by the state police command.</span></p>\r\n<p><span>Also in Jos, the STF accused residents of the city of hoarding information on the bomb blasts.<span>&nbsp;</span></span></p>\r\n<p><span>The STF spokesman, Capt. Charles Nweocha, who spoke with the News Agency of Nigeria on Sunday, said that &ldquo;information flow is very poor among residents.&rdquo;</span></p>\r\n<p><span>He added, &ldquo;The perpetrators are living among the people and we have always asked for information, but we do not get it. People hoard information and this certainly will make it difficult for us to record much success.&rdquo;</span></p>\r\n<p><span>Nweocha disclosed that the STF had continuously solicited information from the public to assist it to deal with situations as they arose.</span></p>\r\n<p><span>&ldquo;We have always advised that people should report any strange movements around them, but no one is doing that. There is a gap and we must work together to bridge it,&rdquo; Nweocha lamented.</span></p>\r\n<p><span>In Abuja, the Senate condemned the bomb explosions in Jos and enjoined security agencies not to allow any plot against the country to go unchallenged.</span></p>\r\n<p><span>It said in a statement by its President, Senator David Mark, that the time had come for security agencies to step up their investigation into the bombings in order to quickly bring the perpetrators to book.</span></p>\r\n<p><span>&ldquo;There should be no sacred cows. No life is more important than the other. This is an act of terrorism. This is unacceptable. Something must be done to save Plateau State,&rdquo; it added.</span></p>\r\n<p><span>The Senate, however, assured that the threats of bomb blasts across the country would not stop the conduct of elections in 2011.</span></p>\r\n<p class="MsoNormal">&nbsp;</p>\r\n</p>\r\n<p>&nbsp;</p>', 1, '2010-10-11 15:48:20', '2010-12-27 10:07:36'),
(7, 'Minimum wage: N18,000 too small â€“ Nyako', '<p>\r\n<p>Yola &mdash; Governor Murtala Nyako of Adamawa has described the N18,000 minimum wage as too small.<br />Speaking with newsmen in an interactive session on Christmas day in Yola, Nyako said the amount was to meagre to cater for a family man.</p>\r\n<p>Nyako was, however, quick to point out that in spite of the small amount, many state governments would find it difficult to implement.</p>\r\n<p>He said this was because of the states&rsquo; sole dependence on the monthly federation account allocation.</p>\r\n<p>Nyako said there was need for states to source for alternatives to oil money if they were to meet the growing developmental needs of their people.</p>\r\n<p>He said it was the zeal to wean Adamawa from over dependence on oil money that his administration engaged in projects such as transforming agriculture by introducing commercial farming.</p>\r\n<p>Other projects, Nayako said, included the technical skills acquisition centres as well as independent power plants for steady electricity to fast_tract industrialisation that would bring more revenue.</p>\r\n<p>The governor explained that the World Bank would be assisting the state with over N7 billion which he described as &ldquo;almost free interest loan&rdquo; payable in 40 years including 10 years moratorium.</p>\r\n<p>The governor also said that Islamic Development Bank would also assist the state in establishing three science schools for the training of personnel</p>\r\n<p>According to Nyako, with steady electricity supply, industries would troop to Adamawa where there would be not only available power, but trained manpower to meet industrial demands.</p>\r\n</p>', 1, '2010-10-11 15:49:18', '2010-12-27 10:10:33'),
(8, 'How Gusau helped make Obasanjo President, by Atiku', '<p>FORMER Vice President Atiku Abubakar has said it was the immediate past National Security Adviser (NSA), Gen. Aliyu Mohammed Gusau, who championed the emergence of Chief Olusegun Obasanjo as President in 1999.</p>\r\n<p><img src="http://www.ngrguardiannews.com/images/resized/images/stories/2010/december2010/atiku-pdp_200_160.jpg" alt="Atiku-PDP" /><br /><br />Atiku, who is fighting for a northern presidential candidate to the Peoples Democratic Party (PDP), has also admitted that there was no zoning in the party in 1999.<br /><br />He said the first tenure of Obasanjo was not based on zoning but as a compensation to the southern part of the country over the annulment of June 12, 1993 presidential election believed to be won by the late business mogul, Chief Moshood Kashimawo Olawale (MKO) Abiola.<br /><br />The election was annulled by former military President, Gen. Ibrahim Babangida, whose bid to return to the Presidency in 2011, was frustrated by the Adamu Ciroma-led northern leaders&rsquo; group under a consensus arrangement.<br /><br />At the Government House, Gusau, Zamfara State during the weekend when Atiku visited Governor Mahmud Aliyu Shinkafi, he said the zoning issue was discussed and sealed when Obasanjo declared his interest to contest for second term.<br /><br />Narrating how Obasanjo emerged the country&rsquo;s President in 1999, Atiku said it was Gusau, who met him in 1998 with the idea of nominating a southerner and Obasanjo in particular to be the PDP presidential candidate.<br /><br />The presidential hopeful, who described himself as being among Nigerians who formed the party, expressed concern over the way Obasanjo attempted to disrupt&nbsp;the whole arrangement through his third term agenda, which was vehemently kicked against by Nigerians.<br /><br />&lsquo;&rsquo;When we formed the PDP in 1998, it was Gen. Aliyu Gusau, who met me and said &lsquo;my brother, you know we are your elders and we know this country better than you. I want to suggest to you people while nominating your presidential candidate you should consider the South, because of what happened to the annulment of June 12 election. By doing this, you will carry the support of all Nigerians. Let us compensate them.&rdquo;<br /><br />Atiku said zoning was aimed at providing equal opportunity to the regions in the country and not for any selfish or regional inclination, insisting that the North must be given its chance to produce the next president of the country by the PDP.<br /><br />While fielding questions from reporters, the presidential aspirant said the incumbency factor would not favour President Goodluck Jonathan, describing the recent endorsement of the President by 22 governors as unrealistic.<br /><br />He said the outcome of the&nbsp;forthcoming party&rsquo;s presidential primary election would confirm his statement and called on all stakeholders to elect credible people that have the nation&rsquo;s interest at heart.<br /><br />Shinkafi described Atiku as a hero who saved the Fourth Republic from collapse following the third term agenda interest of Obasanjo.<br /><br />&ldquo;We are proud of you. You saved our democracy from collapse and if not because of you and other citizens that fought the third term agenda, we woundn&rsquo;t have been here. It was because of that the 2007 election transition became successful and led to our emergence as the leaders of our state,&rsquo;&rsquo; Shinkafi stated.<br /><br />The governor appealed to Nigerians to participate actively in the forthcoming voters&rsquo; registration with a view to ensuring the 2011 polls record high&nbsp;turnout of electorates.<br /><br />Shinkafi also described the emergence of Atiku among the four PDP northern presidential aspirants as unique in the political development of the country, pointing out that after due consultations among the state coordinators of the four former presidential aspirants in the state, Babangida&rsquo;s coordinator in Katsina emerged to be the Atiku&rsquo;s state co-ordinator, Alhaji Aminu Ahmad Nahuche.<br /><br />Atiku said he was not intimidated by the verbal endorsement by the PDP governors and delegates across the country as such were not capable of stopping him from emerging as the party&rsquo;s candidate.<br /><br />He said recent happenings around West Africa and around the world have shown that incumbency is never a factor to winning election but acceptance and performance, saying his achievement as a seasoned politician would facilitate his getting the PDP ticket in January 2011 and subsequently win the presidential elections in April, 2011.<br /><br />Meanwhile, Nigerians in the United States and Canada, at the weekend rose from a meeting, passing a vote of confidence on the administration of Jonathan and Vice President Namadi Sambo.<br /><br />Head of the group who is also the Vice President (Africa) of Joe Trippi and Associates, Reno Omokri, also called on all PDP delegates to vote for the Jonathan/Sambo ticket in the coming PDP primaries.<br /><br />Expressing confidence that Jonathan would sail through the primaries, Omokri urged Nigerians to vote for President Jonathan in the general elections.<br /><br />The group&rsquo;s resolution made available to The Guardian in Kano, gave an insight as to why Jonathan deserved to stay on in power.<br /><br />&ldquo;In coming to this decision, the association took cognisance of the major strides of the administration which include amongst others, allocating the highest amount in the proposed 2011 budget to education at N933 billion, which is three times what was allocated to the next highest sector (Defence) at N313 billion, making modest improvements to the power sector with the implementation of the road-map on Power Sector Reforms.&rdquo;<br /><br />Also, traditional rulers from Ebonyi South Senatorial District has endorsed Jonathan and Governor Martin Elechi, or next year&rsquo;s presidential and governorship elections.<br /><br />The monarchs, who held their end of year meeting at the palace of the ruler of Nkpoghoro autonomous community, Afikpo North Local Council, Ezeogo Cletus Ekuma, said their decision was informed by the track records of the two leaders, pointing out that all that was needed was patience and support of the people for them to stabilize the polity.<br /><br />In a resolution read by the monarch of Ugwulangwu autonomous community, Eze Romanus Iyioku, the rulers noted with happiness that within the short period of his stay in office, Jonathan had endeared himself to Nigerians by his humility, sense of responsibility and drive for super structural reforms.<br /><br />In their remarks after the meeting, Ebonyi State Commissioners for Information and Orientation Hyacinth Ikpor and his Education counterpart, Egwu Chima commended the rulers for their patriotism and efforts at engendering peace at the grassroots.</p>', 1, '2010-10-11 15:51:06', '2010-12-27 10:13:08'),
(9, 'Win an iPhone', '<p><span style="background-color: #000000;"><span style="color: #ffffff;"><span style="font-family: mceinline;">As a way of saying Thank You to the users of our site, we are giving you the chance to win a FREE iPhone handset. All you have to do is place 10 free adverts on our site and add us to your friends list on Facebook to enter our raffle draw </span><span style="font-family: mceinline;"><span style="font-family: mceinline;">and the iPhone could be yours</span></span><span style="font-family: mceinline;"> !</span></span></span></p>\r\n<p><span style="background-color: #000000;"><span style="color: #ffffff;"><br /></span></span></p>', 0, '2010-10-14 23:18:03', '2010-10-15 20:15:56'),
(10, 'whitedrum.com independent review; Celebrating Progress Africa', '<p><strong>By Albert Njoku, <a href="http://technuzu.com/">Technuzu</a></strong></p>\r\n<p><a href="http://whitedrum.com/">www.whitedrum.com</a> is a new entrant to the highly competitive classified adverts market in Nigeria. There are already a few big players in this area ... Initially focused on the Nigerian and UK markets, Whitedrum.com is a product of Deltek Solutions UK and Deltek Solutions Nigeria (two different companies). The motivation for the launch could be summarised in this quote from an email I received from the CEO, Dele Oluwole:</p>\r\n<p>The company recently said:</p>\r\n<p><em>Nigeria is highly populated and we think the good people of Nigeria deserve much more than the classified advert websites we are seeing around today, so we have put in the best of our resources to come out with whitedrum. There are still many more web applications for the Nigerian online market in the pipeline. Our plan for the future is to become a globally preferred classified website as we have long-term plans for countries like Ireland, Canada, <a title="Posts tagged with Ghana" href="http://www.cp-africa.com/tag/ghana/">Ghana</a>, Australia, etc.</em></p>\r\n<p>Users can either log on to the Nigerian or UK version of the website via a menu option at the top left corner of the site. Adverts are then filtered accordingly. The Nigerian version <a title="groups" href="http://www.cp-africa.com/groups/">groups</a> adverts by the States and it is easy to locate information. Advert posting is free and users can upload up to 4 photos. Youtube videos are also allowed. Users have a private dashboard from where they can manage their adverts. At the moment, there are not much adverts since the site just launched.</p>\r\n<p>Did I find any major problems on the site? Not really. There was no functional error as I was able to register, search for and find adverts easily. The only problem facing Deltek Solutions is how to raise awareness about the existence of the website. To this end, I saw they have implemented sharing options for facebook, twitter etc. The sites focus on the UK market as well means contending against industry giants like Loot, Gumtree and a myriad other small sites occupying smaller percentages of the market.</p>\r\n<p>I was a bit overwhelmed by the many colours and graphics though. I kept wondering how this would affect speed. Given that adverts already would contain pictures, additional graphics decoration could come at the expense of speed of execution. I thought this but the site seemed to run pretty fast. (Why does every Nigerian website have to have massive shades of green everywhere?)</p>\r\n<p>Another impressive addition was a geo-location feature for each advert showing the ad posters location on a map. I have not seen this on any other of the Nigerian advert websites. Additional reassurance for would be buyers of advertised goods maybe <img src="file:///C:/Users/Deltek/AppData/Local/Temp/msohtmlclip1/01/clip_image003.gif" border="0" alt="icon smile Tech: New classified adverts website for the Nigerian and UK markets: Whitedrum.com" width="15" height="15" /></p>\r\n<p><span style="text-decoration: underline;">About Technuzu</span></p>\r\n<p><a href="http://technuzu.com/">Technuzu</a> is a technology blog focused on covering African web startups</p>\r\n<p>The name "Technuzu" is a new age term in Igbo language meaning technology. UZU in Igbo means "technical" or "Technician". For more startup news, visit Technuzu online at <a href="http://technuzu.com/">Technuzu.com</a></p>\r\n<p>&nbsp;</p>', 1, '2010-11-06 23:35:15', '2010-11-13 02:07:29');
